const Shoppage = ({ match }) => {
    console.log(match)
 return (
            <div>
<Route exact path={`${match.path}`} component={Shopextent}/>
<Route path={`${match.path}/:collectionId`} component={Collectionpreview }/>

            </div>
        )
    }
 export default Shoppage;
